import * as React from 'react';
import Booking from '../models/booking';

// import { Input, Button,  } from '../common/components/form';

import { Text, Form, Button, Layout } from 'react-lifesg-design-system';
import { ThemeProvider } from "styled-components";
import styled from "styled-components";
import '../App.css';
import '../index.css';

interface Props {
    booking: Booking;
    onChange: (fieldName: string, value: string) => void;
    onSave: () => void;
}

const ModifiedText = styled(Text.H6)`
    color: #1C76D5;
`;

const StyledContainer = styled(Layout.GridContainer)`
    /* grid-template-rows: ; */
    grid-template-columns: 50% 50%;
    grid-template-areas: 
        "row1 row1"
        "row2 row2"
        "row3 row3"
        "row4 row5"
        "row5 row5"
        "row6 row6"
        "row7 row7"
        "row8 row8"
        "row9 row9"
        "row10 row10"
        "row11 row11";
    grid-gap: 0.25rem;
    padding: 25px;
`;

const StyledSection = styled(Layout.Section)`
    margin-top: 8%;
    min-height: 600px;
`;

const Row1 = styled.div`
  grid-area: row1;
  padding: 0.25rem;
`;

const Row2 = styled.div`
  grid-area: row2;
  padding: 0.25rem;
`;

const Row3 = styled.div`
  grid-area: row3;
  padding: 0.25rem;
`;

const Row4 = styled.div`
  grid-area: row4;
  padding: 0.25rem;
`;

const Row5 = styled.div`
  grid-area: row5;
  padding: 0.25rem;
`;

const Row6 = styled.div`
  grid-area: row6;
  padding: 0.25rem;
`;

const Row7 = styled.div`
  grid-area: row7;
  padding: 0.25rem;
`;

const Row8 = styled.div`
  grid-area: row8;
  padding: 0.25rem;
`;

const Row9 = styled.div`
  grid-area: row9;
  padding: 0.25rem;
`;

const Row10 = styled.div`
  grid-area: row10;
  padding: 0.25rem;
`;

const Row11 = styled.div`
  grid-area: row11;
  padding: 0.25rem;
`;


export const BookingForm: React.FunctionComponent<Props> = (props) => {
    return (
        <>
        <StyledSection>
            <StyledContainer>
                <Row1><Text.H3>Add Appointment</Text.H3></Row1>
                <Row2><ModifiedText>Citizen Information</ModifiedText></Row2>
                <Row3>
                    <Form.Select
                        label="Salutation"
                        placeholder="Select"
                        options={[
                            { value: "Mr", label: "Mr" },
                            { value: "Mrs", label: "Mrs" },
                            { value: "Miss", label: "Miss" },
                        ]}
                        valueExtractor={(item) => item.value}
                        listExtractor={(item) => item.label}
                        displayValueExtractor={(item) => item.label}
                    />
                    <Form.Field
                        label="Name"
                    />
                </Row3>

               
                <Row4>
                <Form.Field
                    label="Citizen NRIC / FIN number"
                />
                </Row4>

                <Row5>
                <Form.Field
                    label="Citizen phone number"
                />
                </Row5>
                
                <Row6>
                <Form.Field
                    label="Email Address"
                />
                </Row6>

                <Row7>
                <ModifiedText>Service Provider Information</ModifiedText>
                </Row7>

                <Row8>
                <Form.Select
                    label="Service Name"
                    placeholder="Select"
                    options={[
                        { value: "Idk1", label: "Idk1" },
                        { value: "Idk2", label: "Idk2" },
                        { value: "Idk3", label: "Idk3" },
                    ]}
                    valueExtractor={(item) => item.value}
                    listExtractor={(item) => item.label}
                    displayValueExtractor={(item) => item.label}
                />
                

                
                <Form.Field
                    label="Service Provider Phone Number"
                    placeholder='Type here...'
                />
                </Row8> 
                
                <Row9>
                <Form.Select
                    label="Service Provider"
                    placeholder="Select"
                    options={[
                        { value: "Idk1", label: "Idk1" },
                        { value: "Idk2", label: "Idk2" },
                        { value: "Idk3", label: "Idk3" },
                    ]}
                    valueExtractor={(item) => item.value}
                    listExtractor={(item) => item.label}
                    displayValueExtractor={(item) => item.label}
                />
                </Row9>

                <Row10>
                <Form.Field
                    label="Service Provider Email Address"
                    placeholder='Type here...'
                />
                </Row10>
                
                <Row11>
                <Button.Default
                    onClick={props.onSave}
                >Add</Button.Default>
                </Row11>
            </StyledContainer>

        </StyledSection>

        </>
    );
};
